"use strict";

function f_gold(numArrows, aliceArrows) {
    const n = aliceArrows.length;
    let state = 0;
    let mx = -1;
    for (let mask = 0; mask < (1 << n); mask++) {
        let cnt = 0;
        let points = 0;
        for (let i = 0; i < n; i++) {
            if ((mask >> i) & 1) {
                cnt += aliceArrows[i] + 1;
                points += i;
            }
        }
        if (cnt <= numArrows && mx < points) {
            state = mask;
            mx = points;
        }
    }
    const ans = new Array(n).fill(0);
    for (let i = 0; i < n; i++) {
        if ((state >> i) & 1) {
            ans[i] = aliceArrows[i] + 1;
            numArrows -= ans[i];
        }
    }
    ans[0] = numArrows;
    return ans;
}
